import React from "react";
import Card from "./card";

const Cardlist =({robo})=>{
    const Cardarray = robo.map((user,i)=> {
  return <Card id={robo[i].id} name={robo[i].name} email={robo[i].email} /> ;
    })
    // A func should return something always
    return (
        <>
        {Cardarray}
        </>
    );
}

export default Cardlist;
